INSERT INTO `denon-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Denon-Kopfhörer/Denon AH-D5200.webp;', 'Denon AH-D5200', 'https://www.amazon.de/Denon-AHD5200EM-Premium-Over-Ear-Kopfh%C3%B6rer-Zebraholz/dp/B07HJF9TD4/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3B3X60AL9ISB5&keywords=Denon+AH-D5200&qid=1667230187&qu=eyJxc2MiOiIxLjI1IiwicXNhIjoiMC42MSIsInFzcCI6IjAuOTIifQ%3D%3D&sprefix=%2Caps%2C74&sr=8-3', '398,00', 4.5, 139, 2, '-;Denon;Erwachsener;Ohrumschließend;Kabelgebunden;3,5 mm Klinke;Holz;HIFI-KOPFHÖRER FÜR MUSIK IN AUSGEZEICHNETER QUALITÄT: Die 50mm FreeEdge-Treiber aus besonders robustem Nanofasermaterial minimieren unerwünschte Vibrationen und Verzerrung und sorgen so für eine unübertrefflich präzise Klangwiedergabe|OHRSCHALEN AUS ECHTHOLZ: Die natürlichen Klangeigenschaften des Gehäuses aus echtem Zebraholz unterschützen die Klangdämpfung und erzeugen einen warmen, lebendigen Sound mit dem Over Ear-Kopfhörer|HI-RES AUDIO: Erleben Sie mit dem HiFi Kopfhörer hochauflösende Audioformate mit hervorragender Klangqualität, Detailreichtum und Lebendigkeit|ERSTKLASSIGE HANDWERKSKUNST: Das Gehäuse aus echtem Zebraholz ist hochwertig gefertigt und wird durch weiches Kunstleder organisch zu einem Design ergänzt, das perfekt zur Klangqualität passt|AUßERGEWÖHNLICHER TRAGEKOMFORT: Die universelle Passform und ist leicht genug, dass der Kopfhörer auch bei längerem Tragen nicht unbequem drückt und die Ohrpolster aus weichem Kunstleder und 3D-Memory-Schaum üben nur minimalen Seitendruck aus|LANGLEBIGE MATERIALIEN: Die Haltbarkeit der Materialien garantiert hohe Klangqualität für lange Zeit - den Rahmen des Gehäuses bildet ein haltbarer Bügel aus Aluminiumdruckguss, der für dauerhafte Qualität und axiale Flexibilität bürgt');
INSERT INTO `denon-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Denon-Kopfhörer/Denon AH-D7200.webp;', 'Denon AH-D7200', 'https://www.amazon.de/Denon-AH-D7200-Schwarz/dp/B06XD8HMKK/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=Y3HEA0NR3E9W&keywords=Denon+AH-D7200&qid=1667230196&qu=eyJxc2MiOiIwLjg5IiwicXNhIjoiMC44NiIsInFzcCI6IjAuMjQifQ%3D%3D&sprefix=denon+ah-d5200%2Caps%2C60&sr=8-3', '559,86', 4.3, 237, 1, 'black;Denon;Erwachsener;Ohrumschließend;AUX, Kabelgebunden;3,5 mm Klinke;Holz;HIFI-KOPFHÖRER FÜR MUSIK IN AUSGEZEICHNETER QUALITÄT: Die 50mm FreeEdge-Treiber aus besonders robustem Nanofasermaterial sorgen für High-Resolution-Audio mit minimaler Verzerrung|OHRSCHALEN AUS ECHTHOLZ: Die eleganten und 100 % natürlichen Walnuss-Ohrschalen sind selbstdämpfend, stabil und eliminieren unerwünschte Vibrationen für eine extrem detaillierte, lebendige Wiedergabe mit dem gewissen Extra|EXTREM HOCHWERTIGE VERBINDUNG: Das abnehmbare 7N-Kupferkabel sorgt für bestmögliche Signalübertragung, hat einen langlebigen Metallstecker sowie einen Zierring aus Kupfer und wird in Japan sorgfältig hergestellt|HI-RES AUDIO: Erleben Sie hochauflösende Audioformate mit hervorragender Klangqualität, Detailreichtum und Lebendigkeit|LUXURIÖSE HANDWERKSKUNST: Das natürliche Schafleder auf der Außenseite des Kopfhörerbügels fühlt sich besonders weich und luxuriös an, das abgesteppte Kunstleder auf der Innenseite sorgt für maximalen Komfort und Haltbarkeit|AUßERGEWÖHNLICHER TRAGEKOMFORT: Jede Komponente dieses kompromisslosen Over Ear Kopfhörer dient der Klangqualität, dem Komfort und dem besten Hörerlebnis');
